d1=A.bQ(d0,A.bP("Parivivo relativamente peque\xf1o, de cuerpo robusto anteriormente, algo deprimido a nivel de la cabeza y comprimido cerca del ped\xfanculo caudal. Con escamas de tama\xf1o moderado y generalmente bordeadas de negro. La boca es de tama\xf1o moderado y dirigida dorsalmente.","Aunque ambos sexos son similares en coloraci\xf3n, los machos son m\xe1s vistosos que las hembras, presentando tonalidades amarillo naranja a rojizas, principalmente en las aletas dorsal, anal y caudal.","Esta una especie end\xe9mica de Panam\xe1. Fue registrada en la cuenca alta del R\xedo Caimito, donde es relativamente abundante, especialmente en Altos de Trinidad y La Valdeza, hasta unos 473 metros de altura sobre el nivel del mar. Cabe destacar que estos peces fueron m\xe1s abundantes en sitios con poca o nula contaminaci\xf3n.","Es una especie relativamente com\xfan en las quebradas del \xe1rea del canal de Panam\xe1, Donoso y el Norte de Penonom\xe9, prefiere arroyos de poca profundidad de flujo lento, moderado y fondo arenoso y de grava, con alto contenido de hojarasca y cobertura vegetal",A.bT(c0,c0,c0,A.a([$.aj()[29]],d2),b9,d1),"Los machos alcanzan unos 4 cent\xedmetros de longitud total, mientras que las hembras alcanzan tallas cercanas a 5 cent\xedmetros. Para el muestreo de la cuenca r\xedo Caimito, logramos obtener captura de esp\xe9cimen de talla 1.2 a 5.8 cent\xedmetros de longitud total."),b8,0,"Brachyrhaphis episcopi")
