q=A.bQ(d0,A.bP("Pez peque\xf1o, de cuerpo alargado, cabeza relativamente peque\xf1a y deprimida, boca relativamente peque\xf1a y dirigida dorsalmente, mand\xedbula poco sobresaliente y ojos relativamente grandes. Las aletas pectorales y la anal son de tama\xf1o moderado, mientras que las aletas p\xe9lvicas son m\xe1s peque\xf1as. La aleta dorsal es algo corta (su base mide la mitad o menos de la base de la aleta anal) y se sit\xfaa en una posici\xf3n muy psterior en el cuerpo, cerca de la aleta caudal. La aleta caudal es relativamente grande y redondeada.","Ambos sexos presentan una coloraci\xf3n marr\xf3n amarillenta a marr\xf3n rojizo, las hembras presentan generalmente un oscelo oscuro en la porci\xf3n posterior y dorsal del ped\xednculo, los machos pueden presentar los bordes de las aletas dorsal, anal y caudal de de un color m\xe1s claro o llamativo (amarillento, naranja o verde azulado).","Esta es una especie end\xe9mica de Panam\xe1, distribuida en la porci\xf3n central del pa\xeds. Fue registrada en la cuenca alta del R\xedo Caimito, en la localidad Altos de Trinidad, a unos 473 metros de elevaci\xf3n, donde es poco com\xfan. Esta localidad se caracteriza por una amplia cobertura vegetal y baja contaminaci\xf3n.","Esta especie se encuentra en peque\xf1as quebradas de monta\xf1a, r\xedos poco profundos, medianos a peque\xf1os, con velocidad de corriente de moderada a lenta, con fondos de arena y grava, con alta densidad de hojarasca y cierta cobertura vegetal",A.bT(c0,c0,A.a([$.aj()[19]],d2),p,"(Meek & Hildebrand, 1913)",q),"Esta especie alcanza hasta 6 cent\xedmetros de longitud total."),"Rivulidae",1,"Cynodonichthys brunneus")
