d0=A.bQ(p,A.bP("Pez relativamente peque\xf1o a mediano, bastante comprimido y alto en su porci\xf3n media. El perfil dorsal de la cabeza es curvo (c\xf3ncavo), dando la sensaci\xf3n de presentar una especie de \u201cjoroba\u201d. La cabeza adem\xe1s es relativamente peque\xf1a, con una boca proporcionalmente peque\xf1a que presenta varios dent\xedculos externos que utiliza para alimentarse (al rozarlos con otros peces para desprender las escamas que utiliza como alimento). El ojo es proporcionalmente grande, con su diametro abarcando cerca de un 50% de la longitud de la cabeza.","El cuerpo es de color plateado a amarillento brillante, con la regi\xf3n dorsal verdosa y una franja lateral plateado brillante sobre la cual transcurre generalmente una l\xednea oscura. Sobre la altura de las aletas p\xe9lvicas y a nivel de la l\xednea lateral oscura se observa tambien una mancha circular oscura de tama\xf1o similar al ojo, posteriormente, a nivel del ped\xfanculo caudal, se observa otra mancha oscura de forma romboidal.","Esta especie ocurre en la vertiente Pac\xedfica de Panam\xe1, desde el este de la pen\xednsula de la Palma, en Veraguas, hasta el r\xedo Tuira, en Dari\xe9n, adentr\xe1ndose en territorio colombiano. Esta especie end\xe9mica de Panam\xe1, fue registrada en el R\xedo Caimito, a una altura m\xe1xima de 213 metros sobre el nivel del mar. Fue m\xe1s abundante en la cuenca alta, en la localidad de Valdeza, sin embargo, se distribuye en gran parte de la cuenca. Por su amplia distribuci\xf3n, se puede inferir que esta especie podr\xeda ser tolerante a niveles variables de contaminaci\xf3n.","Esta especie se encuentra en quebradas y r\xedos con velocidades medias o lentas; sin embargo, gustan m\xe1s de las aguas quietas, en donde nadan en grupos numerosos en busqueda de alimento y protecci\xf3n, generalmente cerca de las orillas",A.bT(c0,c0,A.a([$.aj()[35]],d2),o,"(Meek & Hildebrand, 1916)",d0),"La Anchobeta alcanza hasta 17 cent\xedmetros de longitud total."),c1,2,"Roeboides occidentalis")
