p=A.bQ(o,A.bP("Entre las caracter\xedsticas m\xe1s destacadas de este car\xe1cido destacan su cuerpo relativamente alargado, su boca dirigida dorsalmente y con la mand\xedbula inferior proyectada anteriormente, su perfil predorsal casi recto a ligeramente curvo, su l\xednea lateral completa (curva hacia abajo en la parte anterior del cuerpo), su aleta dorsal situada en posici\xf3n posterior, muy por detr\xe1s de la mitad del cuerpo y por detr\xe1s del origen de la aleta anal y su aleta caudal asim\xe9trica, con el l\xf3bulo inferior de mayor tama\xf1o.","Esta especie presenta una coloraci\xf3n general plateado amarillento, verde olivo en el dorso y m\xe1s claro en la porci\xf3n ventral, con una franja plateada conspicua que recorre los costados, generalmente una mancha oscura en el pedunculo caudal y los bordes dorsal y ventral de la cola oscuros.","Esta es una especie end\xe9mica de Panam\xe1, se distribuye desde el r\xedo Tuira, en Dari\xe9n, hasta el oeste de Punta Chame Panam\xe1 Oeste. En el R\xedo Caimito, fue m\xe1s abundante en la cuenca alta, en la localidad La Valdeza, a una altura de 213 metros sobre el nivel del mar. Adem\xe1s, esta especie se encontr\xf3 con menor abundancia en la cuenca media, en las localidades de Santa Rita, Trapichito y Mastranto, as\xed como en la cuenca baja, en el r\xedo Aguacate. Cabe destacar que esta especie podr\xeda ser poco tolerante a la contaminaci\xf3n ya que se observ\xf3 que es m\xe1s abundante en \xe1reas con poca contaminaci\xf3n y mayor concentraci\xf3n de ox\xedgeno.","Esta especie se encuentra en quebradas, reservorios y r\xedos con corriente lenta, asociada a fondos de arena o piedra. Prefiere ambientes sombreados, m\xe1s que las zonas con alta luminosidad.",A.bT(c0,c0,A.a([$.aj()[33]],d2),n,"(Meek & Hildebrand, 1912)",p),"Estos peces alcanzan hasta 6 cent\xedmetros de longitud total."),c1,3,"Gephyrocharax atracaudatus")
n=A.a(["Chupapiedras"],c9)
