m=A.a([$.aj()[16]],d2)
m=A.bQ(n,A.bP("La caracter\xedstica m\xe1s relevante de estos peces es quiz\xe1 la presencia, en ambos sexos, de tent\xe1culos lanceolados, ubicados en el \xe1rea dorsal de hocico. Esta especie presenta adem\xe1s una cabeza ancha y cuerpo deprimido, con el ped\xfanculo caudal ligeramente comprimido. Otra caracter\xedstica importante en esta especie es la presencia de una aleta dorsal adiposa, ubicada sobre la porci\xf3n media del ped\xfanculo caudal, la cual se encuentra sostenida por un elemento r\xedgido.","La coloraci\xf3n de este pez es generalmente oscura (marr\xf3n oscuro) en la porci\xf3n dorsal, ocasionalmente con manchas peque\xf1as de color crema a verdosas, principalmente sobre la cabeza y la nuca, y m\xe1s claro (marr\xf3n-crema) en la porci\xf3n ventral.","Esta es una especie end\xe9mica de Panam\xe1, localizada desde la cuenca del Rio Caimito, Panam\xe1 Oeste, hasta la cuenca del rio Bayano, Provincia de Panam\xe1. En el Rio Caimito esta especie se encontr\xf3 con mayor abundancia en la cuenca alta, en localidad de La Valdeza, a una elevaci\xf3n de 273 m; tambi\xe9n fue muestreada en la cuenca media, en las localidades de Santa Rita y Trapichito, en la Chorrera, a una elevaci\xf3n m\xe1xima de 41 m. Cabe destacar que esta especie no se encontr\xf3 en sitios con altos niveles de contaminaci\xf3n.","Esta especie se encuentra en r\xedos y quebradas con aguas claras, caudal r\xe1pido a moderado a relativamente r\xe1pido y con fondos principalmente rocosos, aunque tambien se encuentra en sustratos arenosos, de grava y cubiertos en parte por hojarasca",A.bT(c0,o,A.a([$.aj()[12]],d2),m,"(Eigenmann & Eigenmann,1989)",c0),"Esta especie alcanza los 25 cent\xedmetros de longitud total."),c2,4,"Ancistrus chagresi")
o=A.a(["Sardina Blanca"],c9)
