n=A.bQ(o,A.bP("La aleta dorsal se situa por delante de la l\xednea media del cuerpo, antes del origen de la aleta anal, el perfil predorsal es curvo y no presenta pigmentaci\xf3n morada o lila en el operculo.","Esta especie presenta el cuerpo plateado brillante, con la regi\xf3n dorsal marr\xf3n verdoso y el abdomen blanquecino a plateado, m\xe1s p\xe1lido. Las aletas pectorales, p\xe9lvicas, anal y dorsal no presentan ning\xfan tipo de manchas, pero suelen tener presentes pigmentos naranjas, rojizos y/o amarillentos. Es caracter\xedstico adem\xe1s la presencia de una mancha oscura difusa y verticalmente alargada en la regi\xf3n humeral (por detr\xe1s del operculo), as\xed como una segunda mancha romboidal en la base de la aleta caudal.","Para la vertiente Pac\xedfica de Panam\xe1, su distribuci\xf3n va desde el R\xedo San Pablo, en Veraguas, hasta el rio Tuira, en Dari\xe9n Astyanax panamensis es una especie nativa para Panam\xe1, en el R\xedo Caimito se registr\xf3 en la cuenca alta, en la localidad de La Valdeza, donde fue m\xe1s abundante, sin embargo; tambi\xe9n se registr\xf3, en abundancias variables (de com\xfan a abundante), en la cuenca media (Santa Rita, Trapichito y Mastranto) y en la cuenca baja (Maribel, Martin S\xe1nchez y r\xedo Aguacate). Astyanax panamensis es una especie tolerante a diferentes niveles de contaminaci\xf3n ya que se observ\xf3 en casi todos puntos muestreados a lo largo de la cuenca del R\xedo Caimito.","Esta especie habita en diversos ecosistemas acu\xe1ticos, siendo bastante generalista. Se puede encontrar en pantanos, quebradas y rios de tama\xf1o moderado a grande, con o sin cobertura boscosa, con corriente de flujo r\xe1pido a medio y fondos de piedra, arena, grava y/o lodo.",A.bT(c0,c0,A.a([$.aj()[26]],d2),l,"(Gi\xfcnther, 1864)",n),"Los machos son m\xe1s peque\xf1os y menos robustos que las hembras, alcanzando tallas m\xe1ximas de hasta 15 cm de longitud total."),c1,5,"Astyanax panamensis")
l=A.a(["Guabina real","Gobio"],c9)
o=A.a([$.aj()[16]],d2)
o=A.bQ(l,A.bP("Esta especie presenta el cuerpo alargado, robusto y ligeramente deprimido, con la cabeza ancha, deprimida, la boca ventral y carnosa, el hocico romo y el perfil ventral bastante plano (en respuesta a su h\xe1bitat bent\xf3nico). Los ojos son relativamente peque\xf1os, muy unidos y presenta adem\xe1s una serie de poros en el canal cef\xe1lico ubicado por detr\xe1s de los 2 poros-oculares. Las aletas p\xe9lvicas se encuentran fusionadas formando una ventosa alargada que le permite adherirse a rocas y otros sustratos s\xf3lidos en zonas de alta corriente.","La coloraci\xf3n general es amarillo verdoso a marr\xf3n amarillento, con una serie de manxchas m\xe1s oscuras en la linea media del cuerpo y ocasionalmente en las aletas dorsales y caudal.","Esta especie se encuentra ampliamente distribuida en la costa Pac\xedfica de Centro Am\xe9rica.\xa0Es una especie nativa para Panam\xe1, fue muestreada y registrada en el R\xedo Caimito, en la cuenca media, en la localidad de Santa Rita, en la Chorrera, a una elevaci\xf3n de 41 m, y en cuenca baja, en los r\xedos Martin S\xe1nchez, a una altura de 20 m, y Aguacate, en Arraij\xe1n, hasta 32 m de elevaci\xf3n. Se encontraron muy pocos individuos durante todo el a\xf1o de muestreo y se asume que podr\xeda haber diferentes factores que estan limitando su abundancia, entre ellos la contaminaci\xf3n en la porci\xf3n baja de la cuenca y la presencia de diferentes barreras f\xedsicas en el r\xedo, las cuales no le permiten a esta especie llegar a zonas menos contaminadas en la porci\xf3n alta de la cuenca.","Esta especie se encuentra en la parte baja de los r\xedos, en zonas con poca velocidad de corriente a zonas con r\xe1pidos, en aguas claras o lodosas, pero bien oxigenadas. Awaous transandeanus es una especie que tiene su ciclo de vida entre el mar y los r\xedos, movilizandose desde la zona baja a zonas m\xe1s elevadas y viceversa.",A.bT(c0,c0,c0,A.a([$.aj()[16]],d2),"(Valenciennes,1837)",o),"Alcanza hasta 30 cm de longitud total."),c3,6,"Awaous transandeanus")
