k=A.bQ(l,A.bP("Esta especie es de tama\xf1o mediano. Su cuerpo es bastante alargado y comprimido, terminado en punta y cubierto por escamas muy peque\xf1as. La boca y los ojos son relativamente peque\xf1os. No presenta aletas p\xe9lvicas, dorsal ni caudal, pero presenta una aleta anal muy larga que cubre la mayor parte de la superficie ventral del cuerpo.","Su coloraci\xf3n es, por lo general, chocolate a pardo oscuro.","Se encuentra en ambas vertientes del Territorio Paname\xf1o. Brachyhypopomus occidentalis es una especie nativa de Panam\xe1. En la cuenca del r\xedo Caimito fue registrada en su porci\xf3n alta, en la localidad de La Valdeza a una altura de 213 metros, y media, en la localidad de Mastranto a 32 metros de elevaci\xf3n. No es una especie abundante en los sitios muestreados.","Se encuentra preferentemente en rios y riachuelos con corrientes calmas o muy lentas, fondos lodosos y arenosos y con abundante vegetaci\xf3n asumergida y/o raices",A.bT(c0,c0,A.a([$.aj()[0]],d2),j,"(Regan, 1914)",k),"Los machos son m\xe1s grandes y robustos que las hembras y pueden llegar a medir hasta 20 cm de longitud total."),"Hypopomidae",7,"Brachyhypopomus occidentalis")
