l=A.bQ(j,A.bP("Esta especie, de tama\xf1o mediano, presenta un cuerpo alargado y ligeramente comprimido, con forma hidrodin\xe1mica. Al igual que los dem\xe1s miembros del g\xe9nero presenta la mand\xedbula superior proyectada anteriormente y al igual que otros Characiformes presenta una aleta dorsal adiposa.  El cuerpo se encuentra totalmente cubierto de escamas, de tama\xf1o moderado y presenta una aleta caudal fuertemente bifurcada.","Es de color plateado amarillento, m\xe1s oscuro (marr\xf3n oliva) dorsalmente y claro (blanco plateado) ventralmente. Una caracter\xedstica distintiva es la presencia, sobre el ped\xfanculo caudal, de una enorme mancha negra, la cual presenta el borde superior azul a verde iridiscente. Las aletas son generalmente incoloras, amarillentas o rojizas.","Para la Rep\xfablica de Panam\xe1 se encuentra exclusivamente en la vertiente Pac\xedfica, desde el R\xedo Caimito, Panam\xe1 Oeste, hasta el rio Tuira, en Dari\xe9n. Es una especie nativa en el pa\xeds y fue registrada, dentro de la cuenca del r\xedo Caimito a unos 213 metros, en la localidad de La Valdeza, y en Santa Rita, a una elevaci\xf3n de 69 metros, con una abundancia intermedia en comparaci\xf3n con otras especies. Esta especie se registr\xf3 en zonas con relativa poca contaminaci\xf3n.","Esta especie se encuentra en r\xedos medianos a grandes, en aguas transparentes a turbias por arcillas, con corriente de velocidad lenta a muy r\xe1pida. Usualmente anda en grupo numerosos cerca de la superficie buscando alimento",A.bT(c0,c0,A.a([$.aj()[31]],d2),i,c4,l),"Esta especie alcanza hasta 30 cent\xedmetros de longitud total y un peso de 500 gramos."),c1,8,"Brycon argenteus")
