j=A.bQ(i,A.bP("Esta especie, de tama\xf1o mediano, presenta un cuerpo alargado y robusto, bastante hidrodin\xe1mico, y cubierto por escamas alargadas. Presenta dos aletas dorsales y la aleta caudal ligeramente recortada.","La coloraci\xf3n general es plateado amarillento, con el dorso verde amarillento a verde oliva, con algunas escamas bordeadas en negro otrog\xe1ndole un patr\xf3n reticulado, y el abdomen blanquecino; sobre los costados se observa una franja plateada que corre desde arriba de la aleta pectoral hasta el inicio de la aleta caudal. Las aletas son generalmente de color amarillento.","Esta especie se distribuye en las dos vertientes de la Rep\xfablica de Panam\xe1, siendo una especie nativa en Panam\xe1. En el R\xedo Caimito fue registrada en la cuenca media, en la localidad de Mastranto en la Chorrera, a unos 32 metros de elevaci\xf3n, y en la cuenca baja, en las localidades de R\xedo Martin S\xe1nchez, a una elevaci\xf3n de 20 metros, y R\xedo Aguacate, en Arraij\xe1n, a unos 32 metros de elevaci\xf3n. La lisa de r\xedo fue una especie poco frecuente en los muestreos, es posible que ciertas barreras f\xedsicas y de contaminaci\xf3n a lo largo de la cuenca den paso a diversas limitaciones para sus ciclos naturales de desarrollo, sobre todo para movilizarse a zonas m\xe1s elevadas.","Esta especie se encuentra en aguas dulces de r\xedos grandes y medianos con corriente de poca a mediana velocidad. Los juveniles generalmente se encuentran en las aguas estuarinas y en peque\xf1as quebradas asociadas a estas, los adultos migran hasta zonas m\xe1s elevadas de los r\xedos.",A.bT(c0,c0,A.a([g[18],g[16]],d2),h,"(Bancroft,1834)",j),"Alcanza hasta 36 cent\xedmetros de longitud total."),"Mugilidae",9,"Dajaus monticola")
