g=A.bQ(h,A.bP("El ojo es bastante grande en proporci\xf3n a la cabesa, la boca y los labios principalmente son bastante carnosos y se pueden distender o protraer anteriormente.  Otras caracter\xedsticas distintivas incluyen una segunda espina anal mucho m\xe1s grande, gruesa y robusta, pero no m\xe1s larga que la segunda espina dorsal; aletas pectorales cortas, no sobrepasando las p\xe9lvicas; y aleta caudal fuertemente ahorquillada.","Esta especie presenta el cuerpo moderadamente alto, con forma de rombo, de color blanco plateado, con l\xedneas oscuras que corresponden a las filas longitudinales de escamas y aletas pectorales, p\xe9lvicas y anales amarillentas.","Esta especie se distribuye en la costa Pac\xedfica de Am\xe9rica desde M\xe9xico hasta Panama. Esta especie es nativa para Panam\xe1. En la cuenca del r\xedo Caimito se encontraron muy pocos individuos en la localidad de Maribel, cuenca baja, a unos 29 metros de elevaci\xf3n, soportando adem\xe1s altos niveles de contaminaci\xf3n.","Esta especie habita en fondos de arena, lodo y piedra en aguas costeras y sube a aguas salobres, incluso se le puede encontrar en aguas dulces cerca de las desembocaduras de los rios.",A.bT(c0,c0,A.a([$.aj()[3]],d2),i,"(G\xfcnther, 1864)",g),"Alcanza una longitud m\xe1xima cercana a los 28 cent\xedmetros"),"Gerreidae",10,"Eugerres brevimanus")
