h=A.bQ(i,A.bP("Esta especie presenta un cuerpo alargado, cil\xedndrico y robusto, con la cabeza generalmente terminada en punta y una cola recortada.","La cabeza y el cuerpo son de color chocolate, marr\xf3n, o marr\xf3n amarillento, moteado con negro y/o rojo en algunos casos, m\xe1s p\xe1lido abajo. Ambas aletas dorsales y la aleta caudal son claras y presentan varias filas de manchitas oscuras en las membranas; las aletas pectoral, p\xe9lvica y anal son claras, la pectoral, adem\xe1s, presenta una banda oscura en su base. Los juveniles presentan una franja oscura en los costados y 3 barras irradiando del ojo (hacia el centro y la parte posterior de la boca, y hacia la esquina superior del op\xe9rculo).","Esta especie se distribuye en la costa Pac\xedfica de Am\xe9rica desde hasta el Golfo de baja California hasta Per\xfa. Gobiomorus maculatus es una especie nativa para Panam\xe1. En la cuenca del r\xedo Caimito se registr\xf3 en la cuenca media, en la localidad de Mastranto, a una elevaci\xf3n de 32 metros, y en cuenca baja, en las localidades de Maribel, a unos 29 m de elevaci\xf3n, r\xedo Martin S\xe1nchez, a unos 20 m de elevaci\xf3n y en el r\xedo Aguacate en Arraij\xe1n, a unos 32 m sobre el nivel del mar. El dormil\xf3n manchado tuvo una abundancia bastante baja en los sitios donde fue registrado, soportando niveles altos niveles de contaminaci\xf3n. Una especie ausente en zonas m\xe1s elevadas probablemente debido a las barreras f\xedsicas que impiden su movilizaci\xf3n y otros gradientes biol\xf3gicos.","Gobiomorus maculatus es un pez di\xe1dromo, que normalmente se encuentra en agua dulce, en diferentes zonas, pero adem\xe1s se puede encontrar en \xe1reas estuarinas y de alta salinidad",A.bT(c0,c0,A.a([$.aj()[21]],d2),f,"(G\xfcnther, 1859)",h),"La talla m\xe1xima reportada para esta especie es de 35 cent\xedmetros de longitud total"),c5,11,"Gobiomorus maculatus")
