e=A.bQ(f,A.bP("Se caracteriza por su cuerpo relativamente alargado, perfil predorsal ligeramente curvo, boca en posici\xf3n superior, ojo relativamente grande, presencia de una sola aleta dorsal en la mitad posterior del cuerpo y aleta caudal grande y redondeada a recortada. Como en otros miembros de la familia, los machos de esta especie presentan un \xf3rgano copulatorio originado a partir de la modificaci\xf3n de la aleta anal.","El patr\xf3n general de coloraci\xf3n es gris amarillento a crema; hacia el centro del cuerpo las escamas son de color plateado, y el abdomen y la superficie inferior de la cabeza son de color plateado a dorado.","Esta especie se distribuye en la vertiente pac\xedfica de Panam\xe1 desde la cuenca del r\xedo Samb\xfa, hacia el oeste en los r\xedos Santa Mar\xeda y Tonos\xed en la pen\xednsula de Azuero. Es una especie end\xe9mica para Panam\xe1. En la cuenca del R\xedo Caimito se ha recolectado desde la porci\xf3n media de la cuenca, en la localidad de Santa Rita, a unos 69 m de elevaci\xf3n, hasta porci\xf3n baja, en el r\xedo Aguacate en Arraij\xe1n a 32 m de elevaci\xf3n. Esta especie de Parivivo presenta una abundancia media en la cuenca, es una especie que se registr\xf3 en zonas con altos niveles de contaminaci\xf3n.","Esta especie es relativaente frecuente en aguas calmas, de fondos arenosos con o sin arcilla, y en menor grado, a fondos rocosos.",A.bT(c0,i,A.a([d[29],d[34]],d2),e,"(Garman,1895)",c0),"Esta es una especie relativamente peque\xf1a, de entre 2,5 y 5 cm de longitud total, siendo las hembras las que alcanzan mayor talla."),b8,12,"Neoheterandria tridentiger")
d=A.bQ(A.a(["R\xf3balo chato"],c9),A.bP("Esta especie es de tama\xf1o mediano a grande cuerpo oblongo, alargado y comprimido; perfil superior de la cabeza distintamente c\xf3ncava, nuca jorobada en adultos; boca grande y protr\xe1ctil, mand\xedbula inferior proyectante; el margen de preop\xe9rculo aserrado; branquiespinas 22-24; radios dorsales VIII + I, 9 (ocasionalmente 10), 3ra espina dorsal ~ igual a la 4ta; radios anales III, 6 (raramente 5), segunda espina anal mucho m\xe1s fuerte que la tercera espina y un poco m\xe1s larga, tambi\xe9n excede la longitud del radio anal m\xe1s largo casi alcanza aleta caudal; aletas p\xe9lvicas insertadas justo detr\xe1s de la base pectoral, con I espina fuerte y 5 radios blandos; radios pectorales 15-17 (usualmente 16); escamas de la l\xednea lateral 46-52 (usualmente 48-51); escamas alrededor del ped\xfanculo caudal 22-25 (usualmente 23-24).",c0,"Esta especie se encuentra distribuida en la costa Pac\xedfica de Am\xe9rica, desde M\xe9xico hasta Per\xfa. Es una especie nativa para Panam\xe1 y en el R\xedo Caimito se fue registrada desde la la cuenca media, en la localidad de Mastranto, hasta la cuenca baja, en el r\xedo Aguacate en Arraij\xe1n a una elevaci\xf3n de 32 metros. Se encontraron muy pocos individuos de esta especie, soportando niveles de contaminaci\xf3n, de all\xed posiblemente su baja abundancia relativa.","Esta especie frecuenta las aguas dulces y las zonas de influencia marina para reproducirse y alimentarse. Llega a ubicar en una profundidad de 0 a 25 metros.",A.bT(c0,c0,A.a([$.aj()[3]],d2),c0,"(Bussing, W.A., 1995)",c0),"Logra obtener una longitud de 36.5 cent\xedmetros."),"Centropomidae",13,"Centropomus unionensis")
