c=A.bQ(i,A.bP("Esta especie de bagre, de talla mediana, presenta un cuerpo desnudo (sin escamas), alargado, casi cil\xedndrico, con el perfil dorsal moderadamente elevado y la parte ventral algo recta. Como otros miembros de la familia presenta tres pares de barbillas alrededor de la boca, la cual se encuentra en posici\xf3n inferior y algo ventral. De igual forma, presenta una aleta dorsal adiposa relativamente larga en la segunda mitad del cuerpo, as\xed como una aleta cuadal bilobulada.","Generalmente son de color gris\xe1ceo claro a marr\xf3n amarillento en casi todo el cuerpo, m\xe1s oscuro dorsalmente, mientras que el abdomen presenta una coloraci\xf3n plateada a blanquecina; con dos lineas laterales horizontales oscuras muy distintivas, una en la mitad del cuerpo y la otra en la porci\xf3n dorsal.","Esta especie se distribuye en Centro y Sur Am\xe9rica; en la vertiente Atl\xe1ntico se distribuye entre en el r\xedo Cocl\xe9 del Norte, en Panam\xe1, hasta los afluentes de la cuenca de Maracaibo, Venezuela; En la vertiente Pac\xedfico, se extiende desde el R\xedo Grande de T\xe9rraba, Costa Rica, hasta el R\xedo San Juan, Colombia. En Panam\xe1 se ha registrado en toda la vertiente del Pac\xedfico y en la vertiente del Atla\xe1ntico desde Col\xf3n hasta Dari\xe9n. Es una especie nativa para Panam\xe1, y en el R\xedo Caimito fue registrado en la cuenca alta (en la localidad de la Valdeza) y cuenca media (en las localidades de Santa Rita y Trapichito), siendo m\xe1s abundante en estos sitios; en la cuenca baja (Maribel) se registraron unos pocos individuos. Dada su distribuci\xf3n en la cuenca, esta especie podr\xeda asociarse con sitios de contaminaci\xf3n baja a moderada.","Se conoce relativamente poco sobre el ciclo de vida y uso de h\xe1bitat de este bagrecillo en las aguas dulces nacionales; no obstante, se sabe que prefiere las aguas claras, en las zonas de corrientes r\xe1pida y moderada, con fondo de piedras y grava, tanto en r\xedos peque\xf1os como en quebradas con algun grado de cobertura boscosa.",A.bT(c0,f,A.a([b[1],b[15]],d2),c,"(Steindachner,1876)",c0),c0),"Heptapteridae",14,"Pimelodella chagresi")
