f=A.bQ(b,A.bP("Esta especie de bagre, de talla mediana, presenta el cuerpo desnudo (sin escamas), alargado, m\xe1s o menos cil\xedndrico anteriormente y algo comprimido cerca del ped\xfanculo caudal. Como otros miembros de la familia presenta tres pares de barbillas alrededor de la boca (los cuales se prolongan m\xe1s all\xe1 del origen de la dorsal, hasta cerca de la mitad del cuerpo), la cual se encuentra en posici\xf3n inferior y algo ventral. De igual forma, presenta una aleta dorsal adiposa bastante larga (que abarca casi todo el espacio entre el final de la aleta dorsal y el origen de la aleta caudal) en la segunda mitad del cuerpo, as\xed como una aleta cuadal bilobulada. En esta especie las aletas pectorales estan soportadas por espinas r\xedgidas que representan una dible aserraci\xf3n (tanto en el borde externo como en el interno).","Esta especie presenta una coloraci\xf3n marr\xf3n amarillento a marr\xf3n oliva, mas oscuro en la porci\xf3n dorsal y blanquecino o crema en la porci\xf3n ventral; una banda oscura estrecha que corre a los lados del cuerpo, desde la cabeza hasta cola, es una caracter\xedstica presente en esta especie.","Esta especie se encuentra en toda Am\xe9rica, desde la regi\xf3n trasandina de Colombia hasta el sur de M\xe9xico. En Panam\xe1 se encuentra en ambas vertientes. Rhamdia guatemalensis es una especie nativa para Panam\xe1; en el R\xedo Caimito, se registraron muy pocos individuos, \xfanicamente en la cuenca media, espec\xedficamente en la localidad de el Trapichito, donde adem\xe1s se registraron niveles intermedios de contaminaci\xf3n.","Esta especie usualmente se encuentra asociada a los fondos lodosos y arenosos, encontr\xe1ndose con frecuencia en distintas zonas de los r\xedos y embalses. Son peces omn\xedvoros, que incluyen en su dieta insectos acu\xe1ticos y terrestres, car\xe1cidos peque\xf1os, crust\xe1ceos, huevos de otros peces y frutos.",A.bT(c0,c0,A.a([$.aj()[17]],d2),f,"(Quoy & Gaimard, 1824)",c0),"El barbudo alcanza hasta 40 cm de longitud total y un peso cercano a los 500 gramos (Gonz\xe1lez-Guti\xe9rrez,2021)."),"Pimelodidae",15,"Rhamdia guatemalensis")
