a=A.bQ(b,A.bP("Esta especie, de talla mediana, persenta un cuerpo con las alargado la cabeza, cuerpo y abdomen cubiertos de placas o escudos d\xe9rmicos de textura \xe1spera. El ped\xfanculo caudal est\xe1 fuertemente deprimido (comprimido dorsoventralmente) y no presenta una aleta dorsal adiposa.","La coloraci\xf3n general es marr\xf3n oscuro a marr\xf3n amarillento, con bandas y o manchas m\xe1s oscuras, tanto en el cuerpo como en las aletas.","Esta especie tiene un patr\xf3n de distribuci\xf3n disruptivo, que va desde el r\xedo Chiriqu\xed Viejo extendi\xe9ndose hacia el Este, hasta alcanzar el r\xedo San Pedro Veraguas, en la parte Oeste de la Pen\xednsula de Azuero. Es una especie nativa para Panam\xe1 y en la cuenca del r\xedo Caimito fue registrada en la parte alta, en la localidad de La Valdeza, a una elevaci\xf3n de 213 m, con muy pocos individuos en zonas poco contaminadas y con mayor concentraci\xf3n de ox\xedgeno.","Esta especie prefiere r\xedos y quebradas con aguas de poca profundidad, de velocidad moderada a r\xe1pida y siempre se encuentran asociados a fondos de piedra, arena, hojarasca y trocos sumergidos. ",A.bT(c0,i,A.a([a0[11],a0[16]],d2),a,"(Kner, 1863)",c0),c0),c2,16,"Rineloricaria uracantha")
