i=A.bQ(a0,A.bP("Este es un pez de talla mediana, cuerpo corto, moderadamente elevado y robusto y cubierto por escamas. El Chogorro presenta una mancha oscura que aparece en la mitad de la dorsal espinosa, otra mancha oscura a la altura del ped\xfanculo caudal, una mancha peque\xf1a oscura triangular en forma de lagrima bajo el ojo y una franja oscura desde esta extendeiendose hacia el op\xe9rculo.","Otra car\xe1cter\xedstica distintiva es la presencia de m\xfaltiples manchas de color azul verdoso iridiscente en el cuerpo y cabeza.","Esta especie se distribuye en Costa Rica y Panam\xe1, en ambas vertientes, con excepci\xf3n de las costas Caribe\xf1as de Bocas del Toro y Veraguas. Esta es una especie nativa para Panam\xe1. En la cuenca del R\xedo Caimito fue registrada en la cuenca alta, en la localidad de la Valdeza, en donde fue m\xe1s abundante, y en la cuenca media, en Santa Rita y Trapichito, en abundancias m\xe1s bajas. Esta especie fue m\xe1s abundante en los sitios menos contaminados.","Esta especie se encuentra en casi todos los ecosistemas acu\xe1ticos, como los r\xedos grandes, medianos y quebradas, de poca a moderada velocidad de corriente, en fondos lodosos, arenosos, pedregosos y/o con abundante hojarasca, as\xed como en pozas, pantanos y reservorios. Igualmente soporta aguas con cierto grado de salinidad y poluci\xf3n.",A.bT(c0,c0,A.a([a1[6],a1[16]],d2),b,c7,i),"Alcanza unos 16 cm de longitud total."),c6,17,"Andinoacara coeruleopunctatus")
