a1=A.bQ(b,A.bP("Esta especie presenta el cuerpo ovalado, alargado y comprimido lateralmente; as\xed como ambos ojos en el lado derecho. El margen de la narina anterior del lado ocular no presenta un anillo de cirros; el hocico redondeado; boca es peque\xf1a y arqueada y se ubica ligeramente por debajo del hocico; el margen frontal de la cabeza presenta tent\xe1culos cortos; y el margen posterior del preop\xe9rculo es visible en forma de un surco cubierto con piel.","La coloraci\xf3n general es marr\xf3n oscuro a marr\xf3n grisaceo, con manchitas oscuras dispersas en todo el cuerpo.","Esta especie se distribuye desde Baja California, pasando por Centro Am\xe9rica, hasta el Per\xfa. Trinectes fonscensis es una especie nativa para Panam\xe1. En la cuenca del r\xedo Caimito solamente fue registrada en la porci\xf3n baja, espec\xedficamente en la localidad de Maribel, a unos 29 metros sobre el nivel del mar; con muy pocos individuos soportando altos niveles de contaminaci\xf3n","Esta especie habita en fondos planos de arena; con frecuencia es capturado en lances de arrastre en zonas costeras; tambi\xe9n entra a estuarios y a las desembocaduras de los r\xedos.",A.bT(c0,c0,c0,A.a([$.aj()[20]],d2),"(G\xfcnther, 1862)",a1),"Alcanza unos 19 cm de longitud total"),"Achiridae",18,"Trinectes fonscensis")
