a0=A.bQ(b,A.bP("Este es un pez grande, de cuerpo alargado y cubierto por placas d\xe9rmicas (excepto en su porci\xf3n ventral), algo aplastado anteriormente y comprimido en la regi\xf3n del ped\xfanculo caudal. Presenta adem\xe1s una aleta dorsal alta, una segunda aleta dorsal adiposa y aletas pares soportadas por espinas muy fuertes y prominentes.","Estos peces son de un color pardo claro, chocolate oscuro o marr\xf3n verdoso, y est\xe1n cubiertos de manchas negras circulares esparcidas de forma irregular en todo el cuerpo y aletas. Estas manchas tambi\xe9n est\xe1n presentes en el abdomen, el cual generalmente es de un color m\xe1s claro, siendo m\xe1s llamativas en peces peque\xf1os y juveniles.","Esta especie se distribuye desde el sur de Costa Rica hasta la Provincia de Panam\xe1, espec\xedficamente en la cuenca/zona del r\xedo Tuira-Dari\xe9n, es decir por toda la vertiente Pac\xedfica del istmo paname\xf1o. Esta es una especie nativa para Panam\xe1, y en la cuenca del r\xedo Caimito fue registrada en su porci\xf3n alta, en la localidad de la Valdeza, y en la cuenca media, en la localidad de Trapichito; en ambos sitios se consider\xf3 una especie relativamente abundante. Algunos pocos individuos fueron registrados en la cuenca baja, en las localidades de Maribel y en el R\xedo Aguacate. Dado esto se puede concluir que es una especie m\xe1s abundante en sitios menos contaminados, no obstante, puede ser una especie bastante tolerante a la contaminaci\xf3n dado que tambien fue registrada en algunos sitios bastante impactados por la poluci\xf3n.","Esta especie se encuentra en zonas con corrientes moderadas y en remansos de r\xedos peque\xf1os y grandes. Por lo general les gusta mantenerse escondidos en las profundidades o debajo de las rocas o troncos de \xe1rboles sumergidos, saliendo a comer en escasas horas del d\xeda. Es un pez herb\xedvoro y tanto los juveniles como los adultos se alimentan de algas.",A.bT(c0,c0,A.a([a3[12],a3[16]],d2),a2,c8,a0),"Alcanza unos 60 cm de longitud total y pesos cercano a 1 Kg."),c2,19,"Hypostomus aspidolepis")
