a3=A.bQ(a2,A.bP("Este es un pez de tama\xf1o mediano, de cuerpo oblongo, con escamas peque\xf1as y moderadamente comprimido, con el hocico terminado en punta, una \xfanica aleta dorsal (del tipo truncada).","El Roncador presenta un patr\xf3n de coloraci\xf3n oliv\xe1ceo oscuro arriba y plateado o blanquecino abajo, con las alteas marr\xf3n amarillento o amarillento. Los juveniles exhiben l\xedneas horizontales onduladas llamativas a lo largo de los costados.","El roncador de r\xedo se distribuye en toda la costa del Pac\xedfico de Amperica, desde baja California hasta Ecuador. En Panam\xe1 se encuentra en toda la vertiente Pac\xedfica desde Chiriqu\xed hasta la Provincia de Dari\xe9n. Rhonciscus bayanus es una especie nativa para Panam\xe1, en el R\xedo Caimito fue registrada en la cuenca media, en la localidad e Mastranto, y en la cuenca baja, en la localidad e Maribel. El roncador de r\xedo obtuvo una abundancia intermedia para la cuenca, soportando altos niveles de contaminaci\xf3n.","Esta especie habita en zonas costera, lagunas, estuarios y la parte baja de los r\xedos. En los r\xedos grandes y medianos, se encuentra en las zonas de corrientes fuertes y rocosas. los adultos, se encuentran m\xe1s cerca de las desembocaduras o m\xe1s bien en aguas salobres, ya que puede tolerar el agua salada.",A.bT(c0,c0,A.a([$.aj()[23]],d2),b,"(Jordan & Evermann,1898)",a3),"Alcanza unos 36 cm de longitud total y un peso aproximado a los 2 kg."),"Haemulidae",20,"Rhonciscus bayanus")
