a2=A.bQ(b,A.bP("Este es un pez mediano a grande, de cuerpo corto, robusto, alto en la parte anterior y un poco comprimido posteriormente. Al igual que otras especies de la familia presenta dos aletas dorsales y aleta cuadl redondeada, difiere por su cuerpo robusto, perfil predorsal curvo y cabeza redondeada.","La coloraci\xf3n general de esta especie es marr\xf3n amarillento a marr\xf3n verdoso, con tonalidades verdosas, lila, doradas, amarillentas y/o rojizas y aletas amarillentas; en la mayor\xeda de ejemplares se observa adem\xe1s una mancha azul verdoso sobre el borde dorsal del l\xedneas y una serie de l\xedneas oscuras que irradian desde el ojoa la mayor parte de la cabeza. Los guapotes machos presentan la papila genital alargada que termina en punta, mientras que en las hembras esta papila es redondeada y posee vellosidades.","Esta especie tiene una amplia distribuci\xf3n en la costa Pac\xedfica de Am\xe9rica, deesde el sur de California, Estados Unidos hasta el norte del Per\xfa, incluyendo tada Centro Am\xe9rica. Es una especie nativa para Panam\xe1, y en el r\xedo Caimito fue registrada en la cuenca baja, en zonas contaminadas como en el r\xedo Mart\xedn S\xe1nchez y el R\xedo Aguacate, en donde fue m\xe1s abundante.","Esta especie se encuentra fuertemente asociada a zonas estuarinas, con velocidades de corriente moderadas a lentas y poca profundidad, con fondo lodosos y arenosos.",A.bT(c0,c0,A.a([a5[10],a5[16]],d2),a4,"(Richardson,1844)",a2),"Alcanza hasta unos 50 cm de longitud total y pesos cercano al 1 kg,"),c5,21,"Dormitator latifrons")
