a5=A.bQ(a4,A.bP("Este es un pez grande, con el cuerpo robusto, alargado, subcil\xedndrico anteriormente y comprimido posteriormente y cubierto por escamas peque\xf1as. Dos caracter\xedsticas destacadas son el op\xe9rculo con escamas peque\xf1as agrupadas, m\xe1s visibles en los peces menores a los 10 cm, y la presencia de una espina preopercular. Para distinguirla de otras especies del g\xe9nero es necesario realizar conteos de escamas ya que presenta entre 60 y 68 escamas laterales, entre 21 y 26 filas de escamas entre el origen de la segunda dorsal y la base de la anal y entre 33 y 40 filas de escamas en torno de la base de la cola.","El perfil predorsal recto y aplanado y el patr\xf3n de coloraci\xf3n (generalmente marr\xf3n oscuro en la porci\xf3n ventral contrastando fuertemente con la marr\xf3n crema o blanquecino de la porci\xf3n dorsal) son tambien caracter\xedsticas distintivas de la especie.","Esta especie se distribuye ampliamente en el Pac\xedcifo de Norte, Centro y Sur Am\xe9rica, desde California hasta Per\xfa, incluyendo las Islas Gal\xe1pagos. Se encuentra en toda la vertiente Pac\xedfica del Istmo Paname\xf1o, siendo una especie nativa. En en el R\xedo Caimito fue registrada en la cuenca media, en la localidad de Mastranto, en donde fue m\xe1s abundante, as\xed como en la cuenca baja, en la localidad de Maribel y en el R\xedo Aguacate, soportando mucha contaminaci\xf3n, lo cual probablemente estar\xeda limitando su capacidad de movilizaci\xf3n a otras zonas de la cuenca.","Este es un pez di\xe1dromo que se ubica en r\xedos y ambientes l\xe9nticos con aguas transparentes o lodosas, con substratos de arena, grava, rocas, lodo y algo de vegetaci\xf3n, incluyendo los manglares. Aunque prefiere las aguas dulces, a veces se encuentra en aguas ligeramente salobres, principalmente en las desembocaduras de los r\xedos.",A.bT(A.a([a5[16],a5[21]],d2),c0,c0,A.a([$.aj()[16]],d2),c7,c0),"El pejesapo es el m\xe1s grande de los Eleotris nacionales y alcanza hasta los 50 cm de longitud."),c5,22,"Eleotris picta")
