b=A.bQ(a4,A.bP("Esta especie presenta el cuerpo alargado, cil\xedndrico anteriormente y comprimido posteriormente. Algunas caracter\xedsticas a destacar son su boca carnosa y papilosa con numerosos dientes alargados, truncados, bic\xfaspides o tric\xfaspides, cuerpo cubierto por escamas peque\xf1as, incluyendo parte del \xe1rea abdominal, la presencia de dos aletas dorsales (la primera extendida en un filamento en los machos) y las aletas p\xe9lvicas fusionadas en forma de una ventosa semicircular (no oval).","La coloraci\xf3n general es marr\xf3n gris\xe1ceo a marr\xf3n verdoso en la porci\xf3n dorsal y blanco amarillento en la porci\xf3n ventral; los juveniles presentan una banda lateral oscura con barras transversales oscuras algo gruesas.","Esta especie se distribuye en el Pac\xedfico de Centro Am\xe9rica desde el R\xedo Tamarindo, Nicaragua hasta el R\xedo C\xe1rdenas, Panam\xe1 central. Sicydium salvini es una especie nativa para Panam\xe1. En el R\xedo Caimito se encontraron muy pocos individuos a una elevaci\xf3n m\xe1xima de 29 m. Esta especie probablemente no es capaz de sobrevivir a altos niveles de contaminaci\xf3n y le es dif\xedcil completar su ciclo de vida por la presencia de barreras f\xedsicas en la cuenca.","Esta es una especie di\xe1dromos que frecuenta r\xedos grandes a peque\xf1os, en agua cristalinas, desde el nivel del mar hasta alturas cercanas a los 660 metros. Se encuentra sobre fondos de piedra y grava en zonas de flujo moderado a r\xe1pido.",A.bT(c0,c0,c0,A.a([a6[2],a6[16]],d2),"(Ogilvie- Grant, 1884)",b),"Esta especie alcanza una longitud de 10 cm."),c3,23,"Sicydium salvini")
