a7=A.bQ(a6,A.bP("Esta especie es de talla mediana, cuerpo relativamente alto y alargado, moderadamente comprimido y cubierto de escamas de tama\xf1o moderado. Presenta el perfil predorsal recto, elev\xe1ndose hasta alcanzar el origen de la aleta dorsal, el hocico truncado, el ojo relativamente grande y posicionado en medio de la cabeza, una aleta dorsal adiposa y la aleta caudal bilobulada. Los adultos de la Sardina man\xe1 se diferencian de las sardinas de r\xedo, por su mayor talla y por la carencia de dientes en las mand\xedbulas.","El patr\xf3n general de coloraci\xf3n es plateado amarillento, m\xe1s oscuro en la porci\xf3n dorsal y claro o blanquecino en la porci\xf3n ventral.","Esta especie se distribuye ampliamente desde las cuencas de los r\xedos Magdalena y Atrato, hasta los r\xedos de la vertiente del Pac\xedfico de Panam\xe1 y suroeste de Costa Rica. Esta es una especie nativa para Panam\xe1. En el R\xedo Caimito se registr\xf3 en la cuenca baja, en el r\xedo Martin S\xe1nchez y en el r\xedo Aguacate, a unos 20 m de elevaci\xf3n. Es una especie de abundancia intermedia que soporta altos niveles de contaminaci\xf3n.","Esta especie se encuentra en un sinn\xfamero de ecosistemas estrictamente dulceacu\xedcolas, como reservorios, ci\xe9nagas, quebradas y r\xedos de caudal moderado. Su alimentaci\xf3n est\xe1 basada en algas, detrito o lodo, de donde extraen su alimento compuesto principalmente por diatomeas.",A.bT(c0,a4,A.a([$.aj()[30]],d2),a7,b9,c0),c0),"Curimatidae",24,"Cyphocharax magdalenae")
