a8=A.bQ(a4,A.bP("Esta especie es de un tama\xf1o peque\xf1o, de cuerpo bastante ancho y bajo anteriormente; est\xe1 totalmente cubierto por escudos carinados y presenta el ped\xfanculo caudal comprimido posteriormente. Presenta adem\xe1s una aleta dorsal adiposa sustentada anteriormente por un elemento r\xedgido. Las aletas pectorales y p\xe9lvicas son bastante desarrolladas y fuertes.","Estos loric\xe1ridos son de color gris oscuro en el dorso y p\xe1lido o blanquecino ventralmente.","Esta especie se encuentra distribuida en la vertiente Pac\xedfica desde la cuenca del r\xedo Tuira, Dari\xe9n, extendi\xe9ndose hacia al oeste hasta probablemente los drenajes del r\xedo Santa Mar\xeda. Esta especie es end\xe9mica de Panam\xe1. En el R\xedo Caimito se registraron relativamente pocos individuos, principalmente en la cuenca alta, en la localidad de La Valdeza, en la cuenca media, en la localidad de el Trapichito, y en la cuenca baja, en la localidad de Maribel. Esto sitios presentan diferentes niveles de poluci\xf3n, esta especie fue registrada en menores abundancias en los sitios m\xe1s contaminados.","Este es un pez poco conocido, ya que vive en peque\xf1as quebradas entre los 30 y 500 m de elevaci\xf3n",A.bT(c0,c0,c0,a6,c4,A.a([a8[1],a8[16]],d2)),"Alcanzan hasta 8 cm de longitud total."),c2,25,"Leptoancistrus canensis")
