a4=A.bQ(a6,A.bP("Este es un pez de forma muy peculiar, tama\xf1o mediano y cuerpo alargado y delgado, adem\xe1s se encuentra cubierto por placas d\xe9rmicas en forma de anillos. El hocico es alargado y tubular, carece de aletas p\xe9lvicas y anal, mientras que la caudal es peque\xf1a y redondeada.","La coloraci\xf3n general del cuerpo depende en gran mediad del lugar en donde se encuentren, pero usualmente muestran un color bronce a chocolate pincelado con negro, con la parte abdominal chocolate oscuro a claro.","Esta especie se encuentra en los r\xedos de la vertiente pac\xedfica de Costa Rica y Panam\xe1. Esta especie es nativa para Panam\xe1. En el R\xedo Caimito se encontraron muy pocos espec\xedmenes en la cuenca baja, en las localidades de Maribel, Mart\xedn S\xe1nchez y en el R\xedo Aguacate, soportando altos niveles de contaminaci\xf3n.","Estos peces usualmente vive en r\xedo medianos y peque\xf1os, de poca a moderada velocidad de corriente, con fondos de piedras de tama\xf1o mediano, grava y arena y con malezas sumergidas o en las orillas",A.bT(c0,c0,A.a([$.aj()[8]],d2),a9,c4,a4),"Alcanza casi los 20 cm de longitud total."),"Syngnathidae",26,"Pseudophallus elcapitanensis")
