b0=A.bQ(a9,A.bP("Este es un pez peque\xf1o, con escamas de tama\xf1o moderado, algo robusto anteriormente y ligeramente comprimido posteriormente. El perfil dorsal se va elevando hasta la aleta dorsal, mientras que la parte ventral es m\xe1s redondeada; la boca es relativamente peque\xf1a y se encuentra dirigida dorsalmente, los ojos son relativamente grandes y la aleta caudal es amplia y redondeada. En los machos el gonopodio es muy corto en comparaci\xf3n con otras especies de la familia.","La coloraci\xf3n general es amarillo verdoso, plateado amarillento o amarillo naranja; en la mayor\xeda de los ejemplares se observan varias hileras horizontales de puntos amarillentos en los costados, as\xed como manchas oscuras en la aleta dorsal y/o caudal.","En su definici\xf3n m\xe1s amplia, esta especie se distribuye en casi toda Centro Am\xe9rica, desde Guatemala hasta el r\xedo Bayano en Panam\xe1. Algunos autores restringen el nombre de esta especie a una poblaci\xf3n paname\xf1a, siendo esta end\xe9mica de Panam\xe1. En el R\xedo Caimito esta especie fue registrada en la cuenca alta, en La Valdeza y en Caimito, en donde fue m\xe1s abundante; tambi\xe9n se registraron algunos individuos en la cuenca media (Santa Rita, Trapichito y Mastranto) y en la cuenca baja (Maribel, R\xedo Mart\xedn S\xe1nchez y R\xedo Aguacate) soportando distintos niveles de contaminaci\xf3n.","Esta especie se encuentra en todo tipo de h\xe1bitats, desde el nivel del mar hasta los 1.220 m de altura. Se encuentra en cuerpos de aguas dulces y ligeramente salobres de todas las velocidades de corriente, pero prefiere las aguas mansas y de poca profundidad",A.bT(c0,a6,A.a([b1[16],b1[24],b1[29]],d2),b0,c7,c0),c0),b8,27,"Poecilia gillii")
