a9=A.bQ(b1,A.bP("Este car\xe1cidos peque\xf1o presenta el cuerpo comprimido, con el perfil predorsal algo convexo, que se eleva hasta alcanzar la aleta dorsal, mientras que la parte ventral es redondeada. El ojo es bastante grande en proporci\xf3n a la cabeza, la aleta dorsal es alta y posicionada casi en la mitad del cuerpo como otros miembros de la familia presenta una aleta dorsal adiposa.","La mayor parte del cuerpo es amarillento a chocolate rojizo a plateado, debido a que las escamas poseen puntos chocolates rojizos en sus bordes posteriores; es evidente adem\xe1s una mancha oscura en el ped\xfanculo caudal, abarcando gran parte de este, y por encima dos manchas amarillo naranja que se extienden a los l\xf3bulos de la caudal, dorsal y ventralmente.","Esta especie se encuentra en ambas vertientes del Istmo de Panam\xe1, siendo una especie end\xe9mica. En el R\xedo Caimito se registr\xf3 en la cuenca alta, en La Valdeza y en Caimito, donde fue m\xe1s abundante. Adem\xe1s, se registraron algunos individuos en la cuenca media, en Santa Rita, sitios con poca o ninguna contaminaci\xf3n y buena cobertura boscosa.","Esta especie frecuenta los h\xe1bitats l\xe9nticos de r\xedos y quebradas de aguas claras y limpias, siempre asociada a \xe1reas con algo de cobertura boscosa. Se considera una especie insect\xedvora y su alimento consiste principalmente de insectos acu\xe1ticos y terrestres, as\xed como de semillas y frutos que caen al agua y ocasionalmente algas",A.bT(c0,a6,A.a([a9[16],a9[14]],d2),A.a([$.aj()[16]],d2),"(Evermann & Goldsborough, 1909)",c0),c0),c1,28,"Compsura gorgonae")
a6=A.bQ(A.a(["Sardina de monta\xf1a","Coquera"],c9),A.bP("Esta especie de sardina es de tama\xf1o peque\xf1o a mediano, de cuerpo alargado, robusto y algo comprimido, cubierto de escamas de tama\xf1o moderado y con el perfil predorsal perfil recto, el cual se va elevando despu\xe9s de la nuca.","Presenta una coloraci\xf3n general plateado verdoso a plateado amarillento, mostrando una leve mancha humeral y sobre la parte media de los laterales presente una banda plomiza que corre desde la cabeza hasta la base de la aleta caudal, en el ped\xfanculo caudal presenta una mancha negra en forma de diamante la cual se extiende un poco hacia la base de los radios medios de la cola; en el op\xe9rculo es evidente adem\xe1s un brillo morado o lila diagn\xf3stico de esta especie.","Esta especie se distribuye en Am\xe9rica Central y del Sur, en las cuencas de los r\xedos Chagres, Tuira, Bayano y Santa Mar\xeda en Panam\xe1 y drenajes costeros del Baud\xf3, San Juan, Atrato y Pac\xedfico en Colombia. Se ubica en toda la vertiente Pac\xedfico del Istmo Paname\xf1o. En la cuenca del Rio Caimito se registr\xf3 esta especie en la porci\xf3n alta, en La Valdeza, en donde fue muy abundante; esta \xe1rea present\xf3 bajos niveles de contaminaci\xf3n.","La sardina de monta\xf1a habita en r\xedos peque\xf1os y quebradas de altura, de corriente leve a moderada, as\xed como en remansos de poca profundidad, asociado con fondos arenosos o de piedra.",A.bT(c0,A.a([$.aj()[16]],d2),c0,A.a([$.aj()[16]],d2),"(Eigenmann & Ogle, 1907)",c0),c0),c1,29,"Eretmobrycon emperador")
b1=A.a(["Guavinita"],c9)
b2=A.a([$.aj()[27]],d2)
b2=A.bQ(b1,A.bP("Esta especie presenta el cuerpo alargado, no mucho m\xe1s profundo que ancho anteriormente, comprimido posteriormente; los ojos cerca de la cima de la cabeza, siendo la distancia entre ellos casi igual al di\xe1metro del ojo; la boca grande y oblicua, con la mand\xedbula inferior fuertemente proyectante; la cabeza, nuca y pecho no presentan escamas; al igual que los otros miembros de la familia presenta dos aletas dorsales y la aleta caudal redondeada.","La coloraci\xf3n general es marr\xf3n oscuro a canela p\xe1lido, con varias manchas oscuras prominentes alargadas en los costados entre las aletas pectorales y la base de la cola.","Esta especie se distribuye en Centro Am\xe9rica, en la vertiente del Pac\xedfico, espec\xedficamente en Panam\xe1 y Costa Rica. En la cuenca del r\xedo Caimito se registraron muy pocos individuos en la porci\xf3n baja, en la localidad de Maribel, a unos 29 m de elevaci\xf3n, y soportando relativamente altos niveles de contaminaci\xf3n.","Esta especie habita en arroyos de aguas blancas y r\xedos a bajas elevaciones, con rocas y escombros, as\xed como sustratos de arena y barro con poca o nula vegetaci\xf3n.",A.bT(c0,c0,c0,A.a([$.aj()[27]],d2),"(Meek & Hildebrand,1916)",b2),"Alcanza una longitud de 5.8 cm."),c5,30,"Leptophilypnus panamensis")
