b3=A.bQ(b1,A.bP("Este es un pez mediano, de cuerpo fusiforme, algo alargado, robusto, algo comprimido y cubierto con escamas de tama\xf1o moderado; presenta la cabeza peque\xf1a, con la mand\xedbula superior sobresaliendo sobre la inferior y dejando descubierta al menos una hilera de dientes. Presenta adem\xe1s una aleta dorsal adiposa, un ped\xfanculo caudal relativamente estrecho y la aleta caudal bilobulada.","Estos peces exhiben el dorso de color azul acero oscuro, mientras que el resto del cuerpo es plateado, un poco m\xe1s p\xe1lido en la regi\xf3n abdominal.","Esta especie se encuentra \xfanicamente en la vertiente del Pac\xedfico de Panam\xe1, desde el r\xedo Caimito en la Chorrera, provincia de Panam\xe1 Oeste, hasta la Provincia del Dari\xe9n, espec\xedficamente en el r\xedo Tuira. En la cuenca del R\xedo Caimito fue registrada en las porciones media, en Trapichito, en donde fue m\xe1s abundante, y baja, en Maribel; este \xfaltimo sitio present\xf3 niveles importantes de contaminaci\xf3n.","Esta especie se encuentra en r\xedos medianos a grandes, de tierras bajas, en aguas transparentes o turbias por acillas, con corrientes de velocidad r\xe1pida a muy r\xe1pida. Usualmente se les observa en grupos numerosos, cerca de la superficie buscando su alimento.",A.bT(c0,c0,c0,A.a([$.aj()[16]],d2),c7,b3),"Alcanza una longitud total de 37cm."),c1,31,"Brycon striatulus")
