b4=A.bQ(b1,A.bP("Este es un pez de talla mediana, con el cuerpo alargado bastante delgado, con el perfil c\xf3ncavo que se eleva suavemente hasta alcanzar la aleta dorsal, mientras que la parte ventral es recta. El ped\xfanculo caudal se presenta una compresi\xf3n importante dorsoventralmente, carece de aleta adiposa y los l\xf3bulos de la aleta caudal presentan unos filamentos bastante largos.",c0,"Esta especie se distribuye en Centro y Sur Am\xe9rica, en r\xedos de la vertiente del Pac\xedfico de Panam\xe1, Colombia y Ecuador y r\xedos de la vertiente caribe\xf1a de Colombia. Se distribuye en el Istmo Paname\xf1o desde el r\xedo Parita en la provincia de Herrera hasta alcanzar el r\xedo Tuira en provincia del Dari\xe9n. En el R\xedo Caimito se registr\xf3 en la cuenca media, en las localidades de Santa Rita y Mastranto y Trapichito, presentando una mayor abundancia en esta \xfaltima localidad y en la cuenca baja, en la localidad de Maribel.  Esta especie soporta niveles bajos e intermedios de contaminaci\xf3n.","Esta especie habita en r\xedos medianos y grandes de aguas claras o transparentes, con corrientes y remansos de velocidad moderada a fuerte y poca profundidad. Poco se conoce de su ciclo de vida, no obstante, en cuanto a su reproducci\xf3n se estima que madura en la estaci\xf3n seca y su periodo de desove puede extenderse hasta entrada la \xe9poca lluviosa.",A.bT(c0,c0,A.a([b6[11],b6[16]],d2),b5,"(Eigenmann & Eigenmann, 1889)",b4),"Esta especie alcanza una longitud de hasta 30 cm."),c2,32,"Sturisomatichthys panamensis")
