b6=A.bQ(b5,A.bP("Esta especie presenta el cuerpo alargado, el perfil superior cef\xe1lico recto, la cabeza peque\xf1a y redondeada y una boca peque\xf1a, relativamente angosta y con peque\xf1as hendiduras laterales. Al igual que en otros miembros de la familia, los machos presentan un gonopodio, constituido por radios anales modificados; la longitud de esta estructura corresponde a un 40-45% de la longitud est\xe1ndar.","Ambos sexos presentan una coloraci\xf3n general gris amarillento a marr\xf3n gris\xe1ceo, oliv\xe1ceo en la porci\xf3n dorsal y gris\xe1ceo ventralmente, con 6-10 barras oscuras bien definidas en los costados. En los machos siempre se observar\xe1 alrededor del est\xf3mago un color amarillento.","Esta especie se distribuye en todo Centro Am\xe9rica hasta llegar a Colombia, en la vertiente Pac\xedfico. En la cuenca del R\xedo Caimito fue registrada solo en la cuenca baja, en el R\xedo Aguacate en Arraij\xe1n, soportando altos niveles de contaminaci\xf3n.","Esta especie se encuentra en ambientes dulceacu\xedcolas, salobres y salados, as\xed como en lagunas costeras y r\xedos.",A.bT(c0,c0,c0,A.a([$.aj()[16]],d2),"(Meek, 1912)",b6),"Esta especie llega a alcanzar una talla m\xe1xima de 9 cm, donde los machos son mucho m\xe1s peque\xf1os que las hembras."),b8,33,"Poeciliopsis turrubarensis")
